import react from "react";


function PREFERENCE()
{
    return(
        <div>
            <div className="contain">
                <a href=""><img src='images/backArrow.png' alt="Bck" className="back"/></a>
                <h6>Your Preferences</h6>
            </div>
            <p>Please confirm your selection</p><br/>

            <div className="Infor">
                <h7>Special Dietary Requirements
                    <p className="backwork">None<img src='images/close.png' alt="" className="close"/></p>
                </h7>

            </div>
        </div>
    )
}

export default PREFERENCE
